import React, { Component, useContext, useEffect, useState } from 'react';
import { BrowserRouter, Route, Switch, Redirect } from 'react-router-dom';
import Dashboard from './pages/index';
import BuySell from './pages/buy-sell';
import Accounts from './pages/accounts';
import Settings from './pages/settings';
import Preferences from './pages/settings-preferences';
import SettingsSecurity from './pages/settings-security';
import SettingsAccount from './pages/settings-account';
import AddBankAccount from './pages/add-bank-acc';
import AddDebitCard from './pages/add-debit-card';
import Locked from './pages/lock';
import Otp1 from './pages/otp-1';
import Otp2 from './pages/otp-2';
import PrivacyPolicy from './pages/privacy-policy';
import Reset from './pages/reset';
import Signin from './pages/signin';
import Signup from './pages/signup';
import TermsCondition from './pages/terms-condition';
import VerifyStep1 from './pages/verify-step-1';
import VerifyStep2 from './pages/verify-step-2';
import VerifyStep3 from './pages/verify-step-3';
import VerifyStep4 from './pages/verify-step-4';
import VerifyStep5 from './pages/verify-step-5';
import VerifyStep6 from './pages/verify-step-6';
import History from './pages/history';
import Demo from './pages/demo';
import Landing from './pages/landing';
import { useDispatch, useSelector } from 'react-redux'
import { fetch_currencies, user_login } from '../redux/actions'
import history from '../history';
import AuthRoute from './routes/AuthRoute'
import BasicRoute from './routes/BasicRoute'
import { connect } from 'react-redux'

const Index = ({checked})=> {

    const dispatch = useDispatch();
    useEffect( ()=>{
        
        dispatch(fetch_currencies());
    }, []);
    // if(!currencies || !currencies.currecyList || currencies.currecyList.length==0)
    return (
        <>  
            {checked && 
            
            <BrowserRouter forceRefresh={true}  basename={'/cheerio-react/'} history={history}>
                <div id="main-wrapper">
                    <Switch>
                        <AuthRoute path='/'> <Dashboard/> </AuthRoute>
                        <AuthRoute path='/buy-sell'> <BuySell/> </AuthRoute>
                        <AuthRoute path='/accounts'> <Accounts/> </AuthRoute>
                        <AuthRoute path='/settings'> <Settings/> </AuthRoute>
                        <AuthRoute path='/settings-preference'> <Preferences/> </AuthRoute>
                        <AuthRoute path='/settings-security'> <SettingsSecurity/> </AuthRoute>
                        <AuthRoute path='/settings-account'> <SettingsAccount/> </AuthRoute>
                        <AuthRoute path='/add-bank-acc'> <AddBankAccount/> </AuthRoute>
                        <AuthRoute path='/add-debit-card'> <AddDebitCard/> </AuthRoute>
                        <AuthRoute path='/lock'> <Locked/> </AuthRoute>
                        <BasicRoute path='/otp-1'> <Otp1/> </BasicRoute>
                        <BasicRoute path='/otp-2'> <Otp2/> </BasicRoute>
                        <AuthRoute path='/privacy-policy'> <PrivacyPolicy/> </AuthRoute>
                        <AuthRoute path='/reset'> <Reset/> </AuthRoute>
                        <BasicRoute path='/signin'> <Signin/> </BasicRoute>
                        <BasicRoute path='/signup'> <Signup/> </BasicRoute>
                        <AuthRoute path='/terms-condition'> <TermsCondition/> </AuthRoute>
                        <AuthRoute path='/verify-step-1'> <VerifyStep1/> </AuthRoute>
                        <AuthRoute path='/verify-step-2'> <VerifyStep2/> </AuthRoute>
                        <AuthRoute path='/verify-step-3'> <VerifyStep3/> </AuthRoute>
                        <AuthRoute path='/verify-step-4'> <VerifyStep4/> </AuthRoute>
                        <AuthRoute path='/verify-step-5'> <VerifyStep5/> </AuthRoute>
                        <AuthRoute path='/verify-step-6'> <VerifyStep6/> </AuthRoute>
                        <AuthRoute path='/history'> <History/> </AuthRoute>
                        <AuthRoute path='/landing'> <Landing/> </AuthRoute>
                        <AuthRoute path='/demo'> <Demo/> </AuthRoute>
                        
                    </Switch>
                </div>
            </BrowserRouter>
            }
        </>
    );
    
}
const mapStateToProps = ({session}) =>({
    checked : session.checked
})
export default connect(mapStateToProps)(Index);
